import React from 'react';

const DeleteUserButton = ({ userId, deleteUser }) => {
  const handleClick = () => {
    // Llama a la funci칩n deleteUser pasando el userId como par치metro
    deleteUser(userId);
  };

  return (
    <button onClick={handleClick}>Eliminar</button>
  );
};

export default DeleteUserButton;
